// export default userEndpoint;

const express = require("express");
const app = express();
import pool from "../../db";
import auth from '../middleware/auth';
import admin from '../middleware/admin';

const userEndpoint = (app) => {
  app.get("/get-users", async (req, res) => {
    try {
      const users = await pool.query("SELECT * FROM akademia.uzytkownik;");
      res.json(users.rows);
    } catch (error) {
      console.error("Bd przy pobieraniu uytkownikw: ", error);
      res.status(500).json({ error: "Bd pobierania danych" });
    }
  });

  app.get("/get-amount-of-users", async (req, res) => {
    try {
      const users = await pool.query("SELECT COUNT(*) FROM akademia.uzytkownik;");
      res.json(users.rows);
    } catch (error) {
      console.error("Bd przy pobieraniu uytkownikw: ", error);
      res.status(500).json({ error: "Bd pobierania danych" });
    }
  });

};



export default userEndpoint;

