import UserDAO from '../DAO/userDAO';
import PasswordDAO from '../DAO/passwordDAO';
import TokenDAO from '../DAO/tokenDAO';
import applicationException from '../service/applicationException';
import bcrypt from 'bcrypt';


function create(context) {
  async function authenticate(adres_email, haslo) {
    let userData;
    try {
      const user = await UserDAO.getUserByEmail(adres_email);
      console.log("Jeste w user w 143 linijce w user.manager:", user);
      if (!user) {
        console.log("Jeste w ifie");
        throw applicationException.new(applicationException.UNAUTHORIZED, 'Uytkownik z tym adresem e-mail nie istnieje');
      }
  
      userData = user;
      console.log("Plik user.manager, 149 linijka, warto userData:", userData);
  
      // Dodaj te linie logw przed wywoaniem bcrypt.compare
      console.log("Przekazane haso:", haslo);
      console.log("Haso z bazy danych (userData.haslo):", userData.haslo);
  
      const isPasswordValid = await bcrypt.compare(haslo, userData.haslo);
      console.log("Plik user.manager, 150 linijka, warto isPasswordValid:", isPasswordValid);
      if (!isPasswordValid) {
        throw applicationException.new(applicationException.UNAUTHORIZED, 'Nieprawidowe haso');
      }
  
      const token = await TokenDAO.createToken(userData);
      console.log(token);
      return token;
    } catch (error) {
      console.error('Jeste w user.manager, 159 lin: authenticate - Error:', error);
      throw error;
    }
  }

  async function createNewOrUpdate(userData) {
    const user = await UserDAO.createNewOrUpdate(userData);
    console.log("Jeste w createNewOrUpdate",user);
    console.log("Jeste przed ifem");
    if (userData.haslo) {
      console.log("Jeste w ifie, userData.haslo",userData.haslo)
      await PasswordDAO.createOrUpdate({ id_uzytkownika: user.id_uzytkownika, haslo: userData.haslo });
    }

    return user;
  }

  async function removeHashSession(id_uzytkownika) {
    return await TokenDAO.remove(id_uzytkownika);
  }

  return {
    authenticate: authenticate,
    createNewOrUpdate: createNewOrUpdate,
    removeHashSession: removeHashSession
  };
}

export const userManager = create();

