// export default admin;

// admin.js
import jwt from "jsonwebtoken";
import config from "../config";
import TokenDAO from "../DAO/tokenDAO"; // Importuj funkcj getUserRole z TokenDAO

const admin = async (req, res, next) => {
  let token = req.headers['x-access-token'] || req.headers['authorization'];
  if (token && token.startsWith('Bearer ')) {
    token = token.slice(7, token.length);
  }
  if (!token) return res.status(401).send('Access denied. No token provided.');

  try {
    req.user = jwt.verify(token, config.JwtSecret);

    // Pobierz rol uytkownika z bazy danych
    const userRole = await TokenDAO.getUserRole(req.user.id);
    req.user.role = userRole; // Dodaj role do obiektu uytkownika
    
    if (!req.user.role === 'admin') {
      return res.status(403).send('Access denied.');
    }
    next();
  } catch (ex) {
    res.status(400).send('Invalid token.');
  }
};

export default admin;

