import pool from "../db";
const express = require('express');
const app = express();
import { userManager } from '../business/user.manager';


const loginEndpoint = (app) => {
// Endpoint dla logowania
app.post('/login', async (req, res) => {
  const { email, password } = req.body;

  try {
    // Tutaj moesz uy userManager do autentykacji uytkownika
    const token = await userManager.authenticate(email, password);
    console.log(token)

    // Odpowied sukcesem i zwr token
    res.status(200).json({ token });
  } catch (error) {
    console.error('Bd logowania:', error);
    // Odpowied bdem
    res.status(401).json({ error: 'Nieprawidowe dane logowania' });
  }
});
}

export default loginEndpoint;

